css:
@-moz-document domain("github.com") {

.side-bar-header-branch {

    color:#949494!important;

}

.side-bar-main span {

    filter:invert(100%);

}

.table-of-content span {

    color:#cda869!important;

}

.table-of-content span[style*="border-left: 2px solid rgb(86, 61, 124); color: rgb(0, 154, 97); padding-left: calc(3em - 2px); text-decoration: none; background-color: rgb(243, 243, 243);"] {

    color:silver!important;

    background-color:black!important;

}

.table-of-content span[style="border-left: 3px solid rgb(86, 61, 124); color: rgb(0, 154, 97); padding-left: calc(1em - 3px); text-decoration: none; background-color: rgb(243, 243, 243);"] {

    color:silver!important;

    background-color:black!important;

}

.table-of-content span[style="border-left: 2px solid rgb(86, 61, 124); color: rgb(0, 154, 97); padding-left: calc(4em - 2px); text-decoration: none; background-color: rgb(243, 243, 243);"] {

    color:silver!important;

    background-color:black!important;

}

.table-of-content span:hover {

    color:silver!important;

    background-color:black!important;

}

.table-of-content-header {

    color:#949494!important;

}

.side-bar-wrap .toggle-btn {

    filter:invert(100%);

}

.table-of-content-wrap .table-of-content-btn {

    filter:invert(100%);

}

.side-bar-wrap {

    background-color:#151515!important;

    background-image: url(data:image/png;base64,)!important;

}

.table-of-content-wrap {

    background-color:#151515!important;

    background-image: url(data:image/png;base64,)!important;

}
}
